'),('es','messages:cite_references_suffix','s:5:\"</ol>\";'),('es','messages:captcha-edit','s:163:\"Para editar este artículo, por favor resuelve la sencilla suma que aparece abajo e introduce la solución en la caja ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-desc','s:81:\"Provee técnicas CAPTCHA para proteger contra spam y adivinación de contraseña.\";'),('es','messages:captcha-label','s:7:\"CAPTCHA\";'),('es','messages:captcha-addurl','s:248:\"Tu edición incluye nuevos enlaces externos.\nPara proteger el wiki contra el spam automatizado, por favor resuelve la sencilla suma de abajo e introduce la respuesta en la caja  para guardar tu edición ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-badlogin','s:191:\"Para proteger el wiki del descifrado de contraseñas automatizado, por favor resuelve la simple suma de abajo e introduce la respuesta en la caja ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-createaccount','s:186:\"Para proteger el wiki de la creación automática de cuentas, resuelve por favor la simple suma de abajo e introduce la respuesta en la caja ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-createaccount-fail','s:57:\"Falta el código de confirmación, o éste es incorrecto.\";'),('es','messages:captcha-create','s:147:\"Para crear la página, por favor resuelve la simple suma de abajo e introduce la respuesta en la caja ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-sendemail','s:209:\"Para proteger el wiki contra el spam automatizado, por favor resuelve la simple suma que se presenta a continuación e introduce la respuesta en el cuadro de texto ([[Special:Captcha/help|más información]]):\";'),('es','messages:captcha-sendemail-fail','s:50:\"El código de confirmación falta o es incorrecto.\";'),('es','messages:captcha-disabledinapi','s:86:\"Esta acción requiere un captcha, así que no puede ser ejecutada a través de un API.\";'),('es','messages:captchahelp-title','s:22:\"Ayuda sobre el captcha\";'),('es','messages:captchahelp-cookies-needed','s:78:\"Debe tener las cookies activadas en el navegador para que el sistema funcione.\";'),('es','messages:captchahelp-text','s:1076:\"Los sitios web que aceptan mensajes del público, como esta wiki, son a menudo objeto de abusos  por spammers que utilizan programas para incluir automáticamente sus enlaces. Si bien estos enlaces pueden quitarse, son una gran molestia.\n\nEn ocasiones, especialmente cuando añada nuevos enlaces a una página, la wiki le mostrará una imagen de texto coloreado o distorsionado y le pedirá que escriba las palabras que muestra. Dado que esta es una tarea difícil de automatizar, permite a la mayoría de las personas enviar sus textos, a la vez que detiene a la mayoría de los spammers y otros atacantes automáticos.\n\nDesafortunadamente esto puede ser un inconveniente para usuarios con visión limitada o para navegadores basados en texto o en voz.\nEn este momento no tenemos una alternativa de audio disponible.\nPor favor contacte a los  [[{{MediaWiki:Grouppage-sysop}}|administradores del sitio]] para asistencia si esto está impidiendiendo inesperadamente que hagas mensajes legítimos.\n\nPresione el botón \'atrás\' en su navegador para retornar al editor de página.\";'),('es','messages:captcha-addurl-whitelist','s:332:\" #<!-- deje esta línea exactamente como está --> <pre>\n# La sintaxis es la siguiente:\n#  * Todo desde un caracter \"#\" hasta el final de la línea es un comentario\n#  * Toda línea que no esté en blanco es un fragmento de expresión regular que se comparará con las URLs\n  #</pre> <!-- deje esta línea exactamente como está -->\";'),('es','messages:right-skipcaptcha','s:77:\"Realiza acciones que despliegan un captcha sin tener que confirmar el captcha\";'),('es','messages:gadgets-desc','s:168:\"Permite a los usuarios seleccionar [[Special:Gadgets|accesorios de CSS y JavaScript personailzados]]\nen sus [[Special:Preferences#mw-prefsection-gadgets|preferencias]].\";'),('es','messages:prefs-gadgets','s:10:\"Accesorios\";'),('es','messages:gadgets-prefstext','s:523:\"Debajo hay una lista de accesorios que puedes activar a tu gusto.\nTen en cuenta que la mayoría de ellos utilizan JavaScript para funcionar, así que debes tenerlo activado en tu navegador si quieres que los accesorios que actives funcionen.\n\nTen en cuenta también que estos complementos no forman parte del software MediaWiki, y están desarrollados por usuarios de este wiki.\n\nLos administradores pueden editar los accesorios que están disponibles en las páginas [[MediaWiki:Gadgets-definition]] y [[Special:Gadgets]].\";'),('es','messages:gadgets','s:10:\"Accesorios\";'),('es','messages:gadgets-title','s:10:\"Accesorios\";'),('es','messages:gadgets-pagetext','s:358:\"Debajo hay una lista de accesorios especiales que los usuarios pueden activar en sus [[Special:Preferences#mw-prefsection-gadgets|preferencias]], según la [[MediaWiki:Gadgets-definition|lista de definición de accesorios]]. Esta vista provee un acceso fácil a las páginas de mensajes del sistema que definen la descripción y el código de cada accesorio.\";'),('es','messages:gadgets-uses','s:4:\"Usos\";'),('es','messages:gadgets-required-rights','s:72:\"Requiere {{PLURAL:$2|el siguiente derecho|los siguientes derechos}}:\n\n$1\";'),('es','messages:gadgets-required-skins','s:79:\"Disponible {{PLURAL:$2|en la apariencia $1|en las siguientes apariencias: $1}}.\";'),('es','messages:gadgets-default','s:45:\"Activado para todos de manera predeterminada.\";'),('es','messages:gadgets-export','s:8:\"Exportar\";'),('es','messages:gadgets-export-title','s:22:\"Exportación de gadget\";'),('es','messages:gadgets-not-found','s:26:\"Gadget \"$1\" no encontrado.\";'),('es','messages:gadgets-export-text','s:411:\"Para exportar el gadget $1, haz click en el botón \"{{int:gadgets-export-download}}\", graba el archivo descargado,\nve a Special:Importar un wiki de destino y subir