ces_error','s:53:\"There must be at least $1 instances of this template.\";'),('es','messages:sf_too_many_instances_error','s:57:\"There must be no more than $1 instances of this template.\";'),('es','messages:sf-pageschemas-otherparams','s:147:\"Enter parameter names and their values as key=value pairs, separated by commas (if a value contains a comma, replace it with \"\\,\"). For example: $1\";'),('es','messages:spam-blacklist','s:611:\" # Enlaces externos que coincidan con esta lista serán bloqueados al añadirse a una página\n # Esta lista afecta sólo a esta wiki. Existe asímismo una lista global en Meta para todos los proyectos. \n # Para documentación mire: https://www.mediawiki.org/wiki/Extension:SpamBlacklist\n #<!-- Deje esta línea exactamente como está --> <pre>\n#\n# La sintaxis es:\n#  * Todo lo que aparezca desde un caracter \"#\" hasta el fin de la línea es un comentario\n#  * Toda línea que no esté en blanco es una expresión regular que sólo se cotejará con URLs\n\n #</pre> <!-- Deje esta línea exactamente como está -->\";'),('es','messages:spam-whitelist','s:454:\" #<!-- Deje esta línea exactamente como está --> <pre>\n# URLs externas que coincidan con esta lista *no* serán bloqueadas incluso si coincidiesen\n# con una entrada en la lista negra.\n#\n## La sintaxis es:\n#  * Todo lo que aparezca desde un caracter \"#\" hasta el fin de la línea es un comentario\n#  * Toda línea que no esté en blanco es una expresión regular que sólo se cotejará con URLs\n\n #</pre> <!-- Deje esta línea exactamente como está -->\";'),('es','messages:email-blacklist','s:660:\" # Las direcciones de correo electrónico que coincidan con las de esta lista no podrán registrar cuentas ni enviar correos electrónicos\n # Esta lista sólo afecta a este proyecto aunque existe una lista global para todos los proyectos.\n # Documentación: https://www.mediawiki.org/wiki/Extension:SpamBlacklist\n #<!-- leave this line exactly as it is --> <pre>\n#\n# Sintaxis como sigue:\n#   * Todo lo que sigue a un \"#\" se interpreta como un comentario\n#   * Toda línea no en blanco es un fragmento de expresión regular (regex) que sólo coincidirá con los \"host\" de la dirección de correo electrónico.\n\n #</pre> <!-- leave this line exactly as it is -->\";'),('es','messages:email-whitelist','s:560:\" #<!-- Deje esta línea exactamente como está --> <pre>\n# Las direcciones de correo electrónico que aparecen en esta lista*no* serán bloqueadas incluso si hubieran\n# debido ser bloqueadas por aparecer en la lista negra.\n#\n #</pre> <!-- Deje esta línea exactamente como está-->\n# La sintaxis es la siguiente:\n#  * Todo texto a la derecha del carácter \"#\" hasta el final de la línea es un comentario\n#  * Cada línea que no esté en blanco es un fragmento de código que será cotejada por los servidores (hosts) con las direcciones de correo electrónico\";'),('es','messages:spam-blacklisted-email','s:51:\"Dirección de correo electrónico de la lista negra\";'),('es','messages:spam-blacklisted-email-text','s:130:\"Su dirección de correo electrónico está actualmente en la lista negra y no puede enviar correos electrónicos a otros usuarios.\";'),('es','messages:spam-blacklisted-email-signup','s:85:\"La dirección de correo electrónico dada está actualmente en la lista negra de uso.\";'),('es','messages:spam-invalid-lines','s:250:\"{{PLURAL:$1|La siguiente línea|Las siguientes líneas}} de la lista negra de spam {{PLURAL:$1|es una expresión regular inválida|son expresiones regulares inválidas}} y es necesario {{PLURAL:$1|corregirla|corregirlas}} antes de guardar la página:\";'),('es','messages:spam-blacklist-desc','s:113:\"Herramienta anti-spam basada en expresiones regulares [[MediaWiki:Spam-blacklist]] y [[MediaWiki:Spam-whitelist]]\";'),('es','messages:syntaxhighlight-desc','s:160:\"Permite resaltar el código fuente usando la etiqueta <code>&lt;syntaxhighlight&gt;</code>. Esta extensión usa [http://qbnz.com/highlighter/ GeSHi Highlighter]\";'),('es','messages:syntaxhighlight-specify','s:41:\"Necesita especificar un idioma como esto:\";'),('es','messages:syntaxhighlight-supported','s:45:\"lenguajes soportados para sintaxis remarcada:\";'),('es','messages:syntaxhighlight-err-loading','s:46:\"(error cargando lista de lenguajes soportados)\";'),('es','messages:syntaxhighlight-err-language','s:18:\"Idioma no válido.\";'),('es','messages:geshi.css','s:78:\"/* El código CSS situado aquí afectará al resaltado de sintaxis de GeSHi */\";'),('es','messages:titleblacklist-desc','s:189:\"Permite que los administradores prohíban la creación de páginas y cuentas de usuario mediante una [[MediaWiki:Titleblacklist|lista negra]] y una [[MediaWiki:Titlewhitelist|lista blanca]]\";'),('es','messages:titleblacklist','s:212:\"# Esta es una lista negra de títulos. No se pueden crear títulos o usuarios que coincidan con una de estas expresiones regulares.\n# Use «#» para comentarios.\n# Esta es insensible a las mayúsculas por defecto\";'),('es','messages:titlewhitelist','s:118:\"# Esta es una lista blanca de títulos. Use «#» para comentarios.\n# Esta es insensible a las mayúsculas por defecto\";'),('es','messages:titleblacklist-forbidden-edit','s:114:\"Se ha bloqueado la creación del título «$2».\nCoincide con la siguiente entrada de lista negra: <code>$1</code>\";'),('es','messages:titleblacklist-forbidden-move','s:162:\"«$2» no puede ser trasladado a «$3», porque se ha bloqueado la creación del título «$3».\nCoincide con la siguiente entrada de lista negra: <code>$1</code>\";'),('es','messages:titleblacklist-forbidden-upload','s:100:\"Se ha bloqueado el nombre de archivo «$2».\nCoincide con la entrada de lista negra <code>$1</code>.\";'),('es','messages:titleblacklist-forbidden-new-account','s:114:\"Se prohibe crear el nombre de usuario «$2».\nCoincide con la siguiente entrada de la lista negra: <code>$1</code>\";'),('es','messages:titleblacklist-invalid','s:172:\"{{PLURAL:$1|La siguiente línea|Las siguientes líneas}} de la lista negra no {{PLURAL:$1|es 