guimiento del progreso de la actualización en esta página especial.\n\nVolver a $1.\";'),('es','messages:smw_smwadmin_updatenotstarted','s:84:\"Ya hay un proceso de actualización ejecutándose.\nNo crear otro más.\n\nVolver a $1.\";'),('es','messages:smw_smwadmin_updatestopped','s:81:\"Todos los procesos de actualización existentes han sido detenidos.\n\nVolver a $1.\";'),('es','messages:smw_smwadmin_updatenotstopped','s:152:\"Para detener el proceso de actualización en ejecución, debes activar la tabla de verificación para indicar que estás realmente seguro.\n\nVolver a $1.\";'),('es','messages:smw_smwadmin_docu','s:239:\"Esta página especial te ayudará durante la instalación y actualización de <a href=\"http://semantic-mediawiki.org\">Semantic MediaWiki</a>.\nRecuerda respaldar cualquier información importante antes de ejecutar funciones administrativas.\";'),('es','messages:smw_smwadmin_db','s:49:\"Instalación de la base de datos y actualización\";'),('es','messages:smw_smwadmin_dbdocu','s:519:\"Semantic MediaWiki necesita algunas extensiones en la base de datos de MediaWiki para poder almacenar la información semántica.\nLa función indicada abajo asegura que tu base de datos está configurada correctamente.\nLos cambios realizados en este paso no afectan el resto de la base de datos de MediaWiki y pueden ser revertidos fácilmente si así se desea.\nEsta función de configuración puede ejecutarse varias veces sin hacer ningún daño, pero es necesaria sólo una vez para la instalación o actualización.\";'),('es','messages:smw_smwadmin_permissionswarn','s:462:\"Si la operación falla con errores SQL, la base de datos de usuarios empleada por su wiki (revise su archivo LocalSettings.php) probablemente no tiene permisos suficientes.\nUd puede conceder a este usuario permisos adicionales para crear y borrar tablas, ingresando temporalmente la clave de acceso de su base de datos raíz en LocalSettings.php, o bien usar el script de mantenimiento <tt>SMW_setup.php</tt>, que puede usar las credenciales de un administrador.\";'),('es','messages:smw_smwadmin_dbbutton','s:31:\"Inicializar o actualizar tablas\";'),('es','messages:smw_smwadmin_announce','s:16:\"Anunciar tu wiki\";'),('es','messages:smw_smwadmin_announcedocu','s:515:\"Semantic MediaWiki cuenta con un servicio Web para anunciar nuevos sitios wiki semánticos, que es usado para mantener un listado de sitios Web públicos que usan Semantic MediaWiki, principalmente para ayudar al <a href=\"http://semantic-mediawiki.org/wiki/SMW_Project\">proyecto Semantic MediaWiki</a>, para tener una visión general de los usos típicos de Semantic MediaWiki.\nSee the Semantic MediaWiki homepage for <a href=\"http://semantic-mediawiki.org/wiki/Registry\">further information about this service</a>.\";'),('es','messages:smw_smwadmin_announcebutton','s:196:\"Presione el botón siguiente para enviar la URL de su wiki al servicio.\nEl servicio no registrará wikis que no sean de acceso público, y solamente guardará información públicamente accesible.\";'),('es','messages:smw_smwadmin_datarefresh','s:37:\"Reparación de datos y actualización\";'),('es','messages:smw_smwadmin_datarefreshdocu','s:571:\"Es posible restaurar toda la información de MediaWiki Semántica basándose en los contenidos actuales de la wiki.\nEsto puede ser útil para reparar la información destruida o para volver a cargar la información si el formato interno ha cambiado a causa de alguna actualización de software.\nLa actualización se ejecuta página a página y no se completará de inmediato.\nLo siguiente muestra es hay una actualización en progreso y le permite iniciar o detener actualizaciones (a menos que esta característica haya sido inhabilitada por el administrador del sitio).\";'),('es','messages:smw_smwadmin_datarefreshprogress','s:476:\"<strong>Actualización en progreso.</strong>\nEs normal que el proceso de actualización se retrase ya que sólo actualiza datos en porciones pequeñas cada vez que un usuario ingresa a la wiki.\nPara finalizar esta actualización en forma mas rápida, Ud. puede invocar el script de matenimiento MediaWiki <tt>runJobs.php</tt> (use la opción <tt>--maxjobs 1000</tt>  para restringir el número de actualizaciones hechas en cada paquete).\nProgeso estimado de la actualización:\";'),('es','messages:smw_smwadmin_datarefreshbutton','s:32:\"Comenzar actualización de datos\";'),('es','messages:smw_smwadmin_datarefreshstop','s:27:\"Detener esta actualización\";'),('es','messages:smw_smwadmin_datarefreshstopconfirm','s:18:\"Sí, estoy seguro.\";'),('es','messages:smw_smwadmin_support','s:16:\"Obteniendo ayuda\";'),('es','messages:smw_smwadmin_supportdocu','s:55:\"Varios recursos podrían ayudarlo en caso de problemas:\";'),('es','messages:smw_smwadmin_installfile','s:241:\"Si experimentas problemas con tu instalación, comienza revisando las líneas guía en el <a href=\"https://gerrit.wikimedia.org/r/gitweb?p=mediawiki/extensions/SemanticMediaWiki.git;a=blob_plain;f=INSTALL;hb=HEAD\">archivo de INSTALACION</a>.\";'),('es','messages:smw_smwadmin_smwhomepage','s:142:\"La documentación de usuario completa a Semantic MediaWiki está en <b><a href=\"http://semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('es','messages:smw_smwadmin_mediazilla','s:92:\"Los defectos pueden ser reportados a <a href=\"https://bugzilla.wikimedia.org/\">Bugzilla</a>.\";'),('es','messages:smw_smwadmin_questions','s:200:\"Si tienes preguntas o sugerencias adicionales, únete a la discusión en <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">Foro de usuarios de Semantic MediaWiki\n</a>.\";'),('es','messages:smw_adminlinks_datastructure','s:19:\"Estructura de datos\";'),('es','messages:smw_adminlinks_displayingdata','s:15:\"Mostrando datos\";'),('es','messages:smw_adminlinks_inlinequerieshelp','s:28:\"Ayuda de consultas en línea\";'),('es','messages:smw-createproperty-isproperty','s:33:\"Esta es una propiedad de tipo $1.\";'),('es','messages:smw-createproperty-allowed