.\nAntes de que se envíe cualquier otro correo a la cuenta tienes que seguir las instrucciones enviadas en el mensaje para así confirmar que la dirección te pertenece.\";'),('es','messages:throttled-mailpassword','s:209:\"Ya se ha enviado un recordatorio de contraseña en {{PLURAL:$1|la última hora|las últimas $1 horas}}.\nPara evitar los abusos, solo se enviará un recordatorio de contraseña cada {{PLURAL:$1|hora|$1 horas}}.\";'),('es','messages:mailerror','s:26:\"Error al enviar correo: $1\";'),('es','messages:acct_creation_throttle_hit','s:279:\"Los visitantes a este wiki usando tu dirección IP han creado {{PLURAL:$1|una cuenta|$1 cuentas}} en el último día, lo cual es lo máximo permitido en este periodo de tiempo.\nComo resultado, los visitantes usando esta dirección IP no pueden crear más cuentas en este momento.\";'),('es','messages:emailauthenticated','s:64:\"Tu dirección de correo electrónico fue autenticada el $2 a $3.\";'),('es','messages:emailnotauthenticated','s:130:\"Aún no has confirmado tu dirección de correo electrónico.\nHasta que lo hagas, las siguientes funciones no estarán disponibles.\";'),('es','messages:noemailprefs','s:77:\"Especifica una dirección electrónica para habilitar estas características.\";'),('es','messages:emailconfirmlink','s:43:\"Confirmar dirección de correo electrónico\";'),('es','messages:invalidemailaddress','s:178:\"La dirección electrónica no puede ser aceptada, pues parece que tiene un formato no válido.\nPor favor, escribe una dirección en el formato adecuado o deja el campo en blanco.\";'),('es','messages:cannotchangeemail','s:101:\"Las direcciones de la correo electrónico de las cuentas de usuario no puedes cambiarse en esta wiki.\";'),('es','messages:emaildisabled','s:59:\"Este sitio no puede enviar mensajes de correo electrónico.\";'),('es','messages:accountcreated','s:13:\"Cuenta creada\";'),('es','messages:accountcreatedtext','s:44:\"La cuenta de usuario para $1 ha sido creada.\";'),('es','messages:createaccount-titl