n asociadas}}\ncon esta dirección de correo electrónico:\n\n$2\n\n{{PLURAL:$3|Esta contraseña temporal|Estas contraseñas temporales}} expirarán en {{PLURAL:$5|un día|$5 días}}.\nDeberías iniciar sesión y establecer una contraseña nueva ahora. Si alguien más hizo este pedido,\no recuerdas tu contraseña original, y no deseas cambiarla, puedes\nignorar este mensaje y continuar usando tu contraseña anterior.\";'),('es','messages:passwordreset-emailtext-user','s:587:\"El usuario $1 en {{SITENAME}} pidió un recordatorio de tus datos de cuenta para {{SITENAME}}\n($4). {{PLURAL:$3|La siguiente cuenta está asociada|Las siguientes cuentas están asociadas}} con esta dirección de correo electrónico:\n\n$2\n\n{{PLURAL:$3|Esta contraseña temporal|Estas contraseñas temporales}} expirarán en {{PLURAL:$5|un día|$5 días}}.\nDeberías iniciar sesión y establecer una contraseña nueva ahora. Si alguien más hizo este pedido,\no recuerdas tu contraseña original, y no deseas cambiarla, puedes\nignorar este mensaje y continuar usando tu contraseña anterior.\";'),('es','messages:passwordreset-emailelement','s:46:\"Nombre de usuario: $1\nContraseña temporal: $2\";'),('es','messages:passwordreset-emailsent','s:80:\"Se ha enviado un correo electrónico para el restablecimiento de tu contraseña.\";'),('es','messages:passwordreset-emailsent-capture','s:103:\"Se ha enviado un correo para el restablecimiento de la contraseña, el cual se muestra a continuación.\";'),('es','messages:passwordreset-emailerror-capture','s:122:\"Un recordatorio por correo electrónico fue generado, que se muestra a continuación, pero el envío al usuario falló: $1\";'),('es','messages:changeemail','s:44:\"Cambiar la dirección de correo electrónico\";'),('es','messages:changeemail-header','s:57:\"Cambiar la dirección de correo electrónico de la cuenta\";'),('es','messages:changeemail-text','s:134:\"Rellena este formulario para cambiar tu dirección de correo electrónico. Debes introducir la contraseña para confirmar este cambi