\n\nA continuación se muestra el registro de borrados y traslados de esta página:\";'),('es','messages:uploadtext','s:916:\"Utiliza el siguiente formulario para subir archivos.\nPara ver o buscar archivos subidos con anterioridad, ve a la [[Special:FileList|lista de archivos subidos]].\nLos archivos subidos quedarán registrados además en el [[Special:Log/upload|registro de archivos subidos]] y los borrados en el [[Special:Log/delete|registro de borrados]].\n\nPara incluir un archivo en una página, usa un enlace como los mostrados a continuación:\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code>\'\'\' para usar el fichero en tamaño completo\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|texto descriptivo]]</nowiki></code>\'\'\' para una versión de 200 píxeles de ancho en una caja en el margen izquierdo con \'texto descriptivo\' como descripción\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code>\'\'\' para enlazar directamente al fichero sin mostrarlo.\";'),('es','messages:upload-permitted','s:32:\"Tipos de archivo permitidos: $1.\";'),('es','messages:upload-preferred','s:32:\"Tipos de archivo preferidos: $1.\";'),('es','messages:upload-prohibited','s:32:\"Tipos de archivo prohibidos: $1.\";'),('es','messages:uploadlog','s:19:\"registro de subidas\";'),('es','messages:uploadlogpage','s:19:\"Subidas de archivos\";'),('es','messages:uploadlogpagetext','s:139:\"Abajo hay una lista de los últimos archivos subidos.\nMira la [[Special:NewFiles|galería de archivos nuevos]] para una descripción visual\";'),('es','messages:filename','s:18:\"Nombre del archivo\";'),('es','messages:filedesc','s:7:\"Sumario\";'),('es','messages:fileuploadsummary','s:13:\"Descripción:\";'),('es','messages:filereuploadsummary','s:19:\"Cambios de archivo:\";'),('es','messages:filestatus','s:20:\"Estado de copyright:\";'),('es','messages:filesource','s:7:\"Fuente:\";'),('es','messages:uploadedfiles','s:16:\