oqueado y oculto. Puesto que usted no tiene el derecho hideuser, usted no puede ver o editar los bloqueos del usuario.\";'),('es','messages:ipbblocked','s:73:\"No puedes bloquear o desbloquear a otros usuarios porque estás bloqueado\";'),('es','messages:ipbnounblockself','s:23:\"No puedes desbloquearte\";'),('es','messages:lockdb','s:25:\"Bloquear la base de datos\";'),('es','messages:unlockdb','s:28:\"Desbloquear la base de datos\";'),('es','messages:lockdbtext','s:381:\"El bloqueo de la base de datos impedirá a todos los usuarios editar páginas, cambiar sus preferencias, modificar sus listas de seguimiento y cualquier otra función que requiera realizar cambios en la base de datos. Por favor, confirme que ésto es precisamente lo que quiere hacer y que desbloqueará la base de datos tan pronto haya finalizado las operaciones de mantenimiento.\";'),('es','messages:unlockdbtext','s:283:\"El desbloqueo de la base de datos permitirá a todos los usuarios editar páginas, cambiar sus preferencias, modificar sus listas de seguimiento y cualesquiera otras funciones que impliquen modificar la base de datos. Por favor, confirme que esto es precisamente lo que quiere hacer.\";'),('es','messages:lockconfirm','s:48:\"Sí, realmente quiero bloquear la base de datos.\";'),('es','messages:unlockconfirm','s:51:\"Sí, realmente quiero desbloquear la base de datos.\";'),('es','messages:lockbtn','s:25:\"Bloquear la base de datos\";'),('es','messages:unlockbtn','s:28:\"Desbloquear la base de datos\";'),('es','messages:locknoconfirm','s:36:\"No ha confirmado lo que desea hacer.\";'),('es','messages:lockdbsuccesssub','s:37:\"El bloqueo se ha realizado con éxito\";'),('es','messages:unlockdbsuccesssub','s:40:\"El desbloqueo se ha realizado con éxito\";'),('es','messages:lockdbsuccesstext','s:136:\"La base de datos de {{SITENAME}} ha sido bloqueada.\n<br />Recuerde retirar el bloqueo después de completar las tareas de mantenimiento.\";'),('es','messages:unlockdbsuccesstext','s:54:\"La base de datos de {{SITENAME}} ha sido desbloqueada.\";'),('es','messages:lockfilenotwritable','s:174:\"El archivo-cerrojo de la base de datos no tiene permiso de escritura. Para bloquear o desbloquear la base de datos, este archivo tiene que ser escribible por el servidor web.\";'),('es','messages:databasenotlocked','s:36:\"La base de datos no está bloqueada.\";'),('es','messages:lockedbyandtime','s:37:\"(por {{GENDER:$1|$1}} el $2 a las $3)\";'),('es','messages:move-page','s:12:\"Trasladar $1\";'),('es','messages:move-page-legend','s:17:\"Renombrar página\";'),('es','messages:movepagetext','s:924:\"Mediante el siguiente formulario puedes renombrar una página, moviendo todo su historial al nombre nuevo.\nEl título anterior redirigirá al nuevo.\nPuedes actualizar automáticamente las redirecciones que apuntan al título original.\nSi eliges no hacerlo, asegúrate de revisar posibles redirecciones [[Special:DoubleRedirects|dobles]] o [[Special:BrokenRedirects|rotas]].\nTú eres responsable de asegurar que los enlaces continúen funcionando correctamente.\n\nNota que la página \'\'\'no\'\'\' se moverá si ya hay una página con el título nuevo, a menos de que ésta sea una redirección y no tenga historial de ediciones pasadas.\nEsto significa que puedes deshacer el renombrado en caso de un error, y que no puedes sobreescribir una página existente.\n\n\'\'\'Aviso\'\'\'\nEsto puede representar un cambio drástico e inesperado para una página popular;\nasegúrate de entender las consecuencias de esta acción antes de proceder.\";'),('es','messages:movepagetext-noredirectfixer','s:896:\"Usando el siguiente formulario se renombrará una página, trasladando todo su historial al nuevo nombre.\nEl título anterior se convertirá en una redirección al nuevo título.\nAsegúrate de no dejar [[Special:DoubleRedirects|redirecciones dobles]] o [[Special:BrokenRedirects|rotas]].\nTú eres responsable de hacer que los enlaces sigan apuntando adonde se supone que deberían hacerlo.\n\nRecuerda que la página \'\'\'no\'\'\' será renombrada si ya existe una página con el nuevo título, a no ser que sea una página vacía o una redirección sin historial.\nEsto significa que podrás renombrar una página a su título original si has cometido un error, pero que no podrás sobrescribir una página existente.\n\n\'\'\'¡Aviso!\'\'\'\nEste puede ser un cambio drástico e inesperado para una página popular;\npor favor, asegúrate de entender las consecuencias del procedimiento antes de seguir adelante.\";'),('es','messages:movepagetalktext','s:400:\"La página de discusión asociada, si existe, será renombrada automáticamente \'\'\'a menos que:\'\'\'\n*Estés trasladando la página entre espacios de nombres diferentes,\n*Una página de discusión no vacía ya exista con el nombre nuevo, o\n*No marques el recuadro «Renombrar la página de discusión asociada».\n\nEn estos casos, deberás trasladar manualmente el contenido de la página de discusión.\";'),('es','messages:movearticle','s:17:\"Renombrar página\";'),('es','messages:moveuserpage-warning','s:154:\"\'\'\'Aviso:\'\'\' estás a punto de trasladar una página de usuario. Ten en cuenta que solo será trasladada la página; el usuario \'\'\'no\'\'\' será renombrado.\";'),('es','messages:movenologin','s:23:\"No has iniciado sesión\";'),('es','messages:movenologintext','s:110:\"Es necesario ser usuario registrado y [[Special:UserLogin|haber iniciado sesión]] para renombrar una página.\";'),('es','messages:movenotallowed','s:42:\"No tienes permiso para trasladar páginas.\";'),('es','messages:movenotallowedfile','s:42:\"No tienes permiso para trasladar archivos.\";'),('es','messages:cant-move-user-page','s:75:\"No tienes permiso para trasladar páginas de usuario (excepto subpáginas).\";'),('es','messages:cant-move-to-user-page','s:105:\"No tienes permiso para trasladar una página a una página de usuario (excepto a subpáginas de usuario).\";'),('es','messages:newtitle','s:16:\"A título nuevo:\";'),('es','messages:move-watch','s:36:\"Vigilar páginas de origen