au800 chimba '),(11,'paque-nacional-cerro-morenou82ejpgu800',' parque nacional cerro moreno '),(12,'parque nacional morro moreno',' parque nacional nombre parque nacional morro moreno tipo parque nacional divisiu8c3b3n region deu800 antofagasta subdivisiu8c3b3n provincia deu800 antofagasta ciudad cercana antofagasta superficie 7u800u82e314u800 hau800 imagen paque-nacional-cerro-morenou82ejpgu800 elu800 nombre parque nacional morro moreno seu800 encuentra enu800 elu800 sector deu800 lau800 penu8c3adnsula deu800 mejillones regiu8c3b3n deu800 antofagasta localizado enu800 lau800 cordillera deu800 lau800 costa entre lasu800 comunas deu800 antofagasta yu800 mejillones deu800 lau800 provincia yu800 regiu8c3b3n deu800 antofagasta. estu8c3a1 ubicado au800 65u800 kilu8c3b3metros alu800 norte deu800 lau800 comuna antofagasta suu800 superficie corresponde au800 unu800 total deu800 superficie 7u800u82e314u800 hau800 7u800u82e314u800 hectu8c3a1reas enu800 este atractivo lugar existe unau800 diversidad deu800 ambientes continentales marinos eu800 insulares queu800 poseen importantes yu800 variados recursos faunu8c3adsticos vegetacionales geolu8c3b3gicos-geomorfolu8c3b3gicos paisaju8c3adsticos yu800 arqueolu8c3b3gicos u8c3banicos enu800 chile. destaca elu800 relieve montau8c3b1oso quebradas lomajes yu800 roqueru8c3ados yu800 formaciones vegetales deu800 niebla como elu800 u8e2809cdesierto costero deu800 tocopillau8e2809d. este sitio permite elu800 establecimiento deu800 90u800 especies deu800 flora silvestre algunas sonu800 u8c3banicas deu800 este lugar esu800 decir sonu800 endu8c3a9micas; hasta hoyu800 seu800 hanu800 reportado 195u800 especies deu800 fauna silvestre entre losu800 queu800 destacan elu800 zorro chilla yu800 gaviotu8c3adn chico. hacia lau800 costa esu800 posible observar alu800 pingu8c3bcino deu800 humboldt chungungo elu800 lobo fino austral entre otros. '),(13,'villarrica',' #redirecciu8c3b3n parque nacional morro moreno ');
