INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki ha sido instalado con éxito.\'\'\'\n\nConsulta la [//meta.wikimedia.org/wiki/Ayuda:Guía del usuario de contenidos] para obtener información sobre el uso del software wiki.\n\n== Empezando ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Lista de ajustes de configuración]\n* [//www.mediawiki.org/wiki/Manual:FAQ/es FAQ de MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de distribución de MediaWiki]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Regionalizar MediaWiki para tu idioma]','utf-8'),(2,'Property test:  [[testproperty::Dummypage]]','utf-8'),(3,'La [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posse una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.','utf-8'),(4,'[[Has type::quantity]]','utf-8'),(5,'Esta es una propiedad que representa una [[Has type::quantity|cantidad]] asociada a la distancia que separa a un lugar geográfico de la capital de la región en donde dicho lugar se encuentra ubicado.\n\nLa distancia antes mencionada puede ser expresada en distintas unidades, siendo la unidad estándar base el Kilómetro (km). Un km. puede ser expresado como:\n\n* [[Corresponds to::1 km, kilometro]]\n* [[Corresponds to::1.000 m, metro]]\n* [[Corresponds to::0.621371192 mi, millas]]','utf-8'),(6,'Esta es una propiedad que representa una [[Has type::quantity|cantidad]] asociada a la superficie ocupada por un sector geográfico.\n\nLa superficie antes mencionada puede ser expresada en distintas unidades, siendo la unidad estándar base el kilómetro cuadrado (km<sup>2</sup>). Un km<sup>2</sup> puede ser expresado como:\n\n* [[Corresponds to::1 km cuadrado, km2]]\n* [[Corresponds to::100 ha, hectárea]]','utf-8'),(7,'Esta es una propiedad que representa una [[Has type::quantity|cantidad]] asociada a la superficie ocupada por un sector geográfico.\n\nLa superficie antes mencionada puede ser expresada en distintas unidades, siendo la unidad estándar base el kilómetro cuadrado (km<sup>2</sup>). Un km<sup>2</sup> puede ser expresado como:\n\n* [[Corresponds to::1 km cuadrado, km2, kilómetro cuadrado]]\n* [[Corresponds to::100 ha, hectárea]]','utf-8'),(8,'Esta es una propiedad que representa una [[Has type::quantity|cantidad]] asociada a la superficie ocupada por un sector geográfico.\n\nLa superficie antes mencionada puede ser expresada en distintas unidades, siendo la unidad estándar base el kilómetro cuadrado (km<sup>2</sup>). Un km<sup>2</sup> puede ser expresado como:\n\n* [[Corresponds to::1 km2, kilómetro cuadrado]]\n* [[Corresponds to::100 ha, hectárea]]','utf-8'),(9,'La [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.','utf-8'),(10,'\'\'\'Disclaimer\'\'\'\n\nEsta wiki sirve como una guía para parques y reservas nacionales de Chile :D. La información ha sido obtenida tanto de Wikipedia, Conaf y algunos archivos del OpenData del gobierno de Chile.\n\n== Reservas Naturales ==\n\n{{#ask: [[Tipo::Reserva natural]] \n | ?Nombre\n | ?Pertenece a la division\n | format=table\n | mainlabel=-\n}}\n\n== Empezando ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Lista de ajustes de configuración]\n* [//www.mediawiki.org/wiki/Manual:FAQ/es FAQ de MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de distribución de MediaWiki]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Regionalizar MediaWiki para tu idioma]','utf-8'),(11,'<noinclude>\nEste es la plantilla \'Parque Nacional\'. Debe ser llamada en el siguiente formato:\n<pre>\n{{Parque Nacional\n|Nombre=\n|División=\n|Subdivisión=\n|Ciudad cercana=\n|Tipo=\n|Superficie=\n}}\n</pre>\nEditar la página para ver el texto de la plantilla.\n</noinclude><includeonly>{| style=\"width: 30em; font-size: 90%; border: 1px solid #aaaaaa; background-color: #f9f9f9; color: black; margin-bottom: 0.5em; margin-left: 1em; padding: 0.2em; float: right; clear: right; text-align:left;\"\n! style=\"text-align: center; background-color:#ccccff;\" colspan=\"2\" |<big>{{PAGENAME}}</big>\n|-\n! Nombre\n|  [[Nombre::{{{Nombre|}}}]] \n|-\n! División\n|  [[Pertenece a la division::{{{División|}}}]] \n|-\n! Subdivisión\n|  [[Pertenece a la subdivion::{{{Subdivisión|}}}]] \n|-\n! Ciudad cercana\n|  [[Esta cerca de::{{{Ciudad cercana|}}}]] \n|-\n! Tipo\n|  [[Tipo::{{{Tipo|}}}]] \n|-\n! Superficie\n|  [[Superficie::{{{Superficie|}}}]] \n|}\n</includeonly>','utf-8'),(12,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Tipo=Reserva nacional\n|Superficie=2.583 ha\n}}\n\nLa [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.','utf-8'),(13,'<noinclude>\nEste es la plantilla \'Parque Nacional\'. Debe ser llamada en el siguiente formato:\n<pre>\n{{Parque Nacional\n}}\n</pre>\nEditar la página para ver el texto de la plantilla.\n</noinclude><includeonly>{| class=\"wikitable\"\n|}\n</includeonly>','utf-8'),(14,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Tipo=Reserva nacional\n|Superficie=2.583 ha\n}}\n\nLa [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.\n\n[[Has image:chimba.jpg]]','utf-8'),(15,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Tipo=Reserva nacional\n|Superficie=2.583 ha\n}}\n\nLa [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.\n\n[[Has image::chimba.jpg]]','utf-8'),(16,'<noinclude>\nEste es la plantilla \'Parque Nacional\'. Debe ser llamada en el siguiente formato:\n<pre>\n{{Parque Nacional\n|Nombre=\n|Tipo=\n|División=\n|Subdivisión=\n|Ciudad cercana=\n|Distancia a la capital regional=\n|Superficie=\n|Declarada el=\n|Imagen=\n}}\n</pre>\nEditar la página para ver el texto de la plantilla.\n</noinclude><includeonly>{| style=\"width: 30em; font-size: 90%; border: 1px solid #aaaaaa; background-color: #f9f9f9; color: black; margin-bottom: 0.5em; margin-left: 1em; padding: 0.2em; float: right; clear: right; text-align:left;\"\n! style=\"text-align: center; background-color:#ccccff;\" colspan=\"2\" |<big>{{PAGENAME}}</big>\n|-\n! Nombre\n|  [[Nombre::{{{Nombre|}}}]] \n|-\n! Tipo\n| {{#arraymap:{{{Tipo|}}}|,|x|[[Tipo::x]]}}\n|-\n! División\n|  [[Pertenece a la division::{{{División|}}}]] \n|-\n! Subdivisión\n|  [[Pertenece a la subdivion::{{{Subdivisión|}}}]] \n|-\n! Ciudad cercana\n|  [[Esta cerca de::{{{Ciudad cercana|}}}]] \n|-\n! Distancia a la capital regional\n|  [[Distancia capital regional::{{{Distancia a la capital regional|}}}]] \n|-\n! Superficie\n|  [[Superficie::{{{Superficie|}}}]] \n|-\n! Declarada el\n|  [[Declarada el::{{{Declarada el|}}}]] \n|-\n! Imagen\n|  [[Has image::{{{Imagen|}}}]] \n|}\n\n[[Categoría:Parques Nacionales]]\n</includeonly>','utf-8'),(17,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|Tipo=Reserva nacional\n|División=Region 