e ser llamada en el siguiente formato:\n<pre>\n{{Parque Nacional\n|Nombre=\n|Tipo=\n|División=\n|Subdivisión=\n|Ciudad cercana=\n|Distancia a la capital regional=\n|Superficie=\n|Declarada el=\n|Imagen=\n}}\n</pre>\nEditar la página para ver el texto de la plantilla.\n</noinclude><includeonly>{| style=\"width: 30em; font-size: 90%; border: 1px solid #aaaaaa; background-color: #f9f9f9; color: black; margin-bottom: 0.5em; margin-left: 1em; padding: 0.2em; float: right; clear: right; text-align:left;\"\n! style=\"text-align: center; background-color:#ccccff;\" colspan=\"2\" |<big>{{PAGENAME}}</big>\n|-\n|colspan=\"2\"|  [[Image:{{{Imagen}}}|center|200px]] [[Has image::{{{Imagen|}}}| ]] \n|-\n! Tipo\n| {{#arraymap:{{{Tipo|}}}|,|x|[[Tipo::x]]}}\n|-\n! División\n|  [[Pertenece a la division::{{{División|}}}]] \n|-\n! Subdivisión\n|  [[Pertenece a la subdivion::{{{Subdivisión|}}}]] \n|-\n! Ciudad cercana\n|  [[Esta cerca de::{{{Ciudad cercana|}}}]] \n|-\n! Distancia a la capital regional\n|  [[Distancia capital regional::{{{Distancia a la capital regional|}}}]] \n|-\n! Superficie\n|  [[Superficie::{{{Superficie|}}}]] \n|-\n! Declarada el\n|  [[Declarada el::{{{Declarada el|}}}]] \n|}\n\n[[Categoría:Parques Nacionales]]\n</includeonly>','utf-8'),(39,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|Tipo=Reserva nacional\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Distancia a la capital regional=18 km\n|Superficie=2.583 ha\n|Declarada el=May 12 1988\n|Imagen=Reserva chimba.jpg | [[Image:{{{Imagen|}}}|200px]]\n}}\nLa [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.\n\n[[Has image::Reserva chimba.jpg| ]]','utf-8'),(40,'{{Parque Nacional\n|Nombre=Reserva Nacional La Chimba\n|Tipo=Reserva nacional\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Distancia a la capital regional=18 km\n|Superficie=2.583 ha\n|Declarada el=May 12 1988\n|Imagen=Reserva chimba.jpg | [[Image:{{{Imagen|}}}|200px]]\n}}\nLa [[nombre::Reserva Nacional La Chimba]] es una [[tipo::Reserva natural|reserva natural]] de [[Es reserva natural de::Chile]], ubicada en la comuna de [[Esta cerca de::Antofagasta]], en la [[Pertenece a la subdivion::Provincia de Antofagasta|provincia]] y [[Pertenece a la division::Region de Antofagasta|región]] homónimas. Posee una superficie de [[Superficie::2.583 ha|2.583 hectáreas]] y se encuentra a [[Distancia capital regional::18 km|18 kilómetros]] de la capital regional. Fue declarado [[tipo::Reserva nacional|Reserva Nacional]] mediante el Decreto 71 del Ministerio de Agricultura el [[Declarada el::May 12 1988|12 de mayo de 1988]], publicado en el Diario Oficial el 13 de julio del mismo año.\n\nSe caracteriza por su microclima de tipo [[microclima::Desertico costero|desértico costero]] el cual permite la existencia de cerca de 90 especies vegetales. Dentro del área protegida se encuentran las quebradas de La Chimba y Los Cactus, así como se presentan diversos acantilados como muestra de la existencia de la Cordillera de la Costa.','utf-8'),(41,'Parque Nacional Cerro Moreno','utf-8'),(42,'{{Parque Nacional\n|Nombre=Parque Nacional Morro Moreno\n|Tipo=Parque nacional\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Imagen=Paque-nacional-cerro-moreno.jpg\n}}\n\n\nEl [[nombre::Parque Nacional Morro Moreno]] se encuentra en el sector de la península de Mejillones, Región de Antofagasta, localizado en la cordillera de la Costa entre las comunas de Antofagasta y Mejillones, de la provincia y región de Antofagasta. Está ubicado a 65 kilómetros al norte de la comuna Antofagasta, su superficie corresponde a un total de [[Superficie::7.314 ha|7.314 hectáreas]]\n\nEn este atractivo lugar  existe una diversidad de ambientes continentales, marinos e insulares que poseen importantes y variados recursos faunísticos, vegetacionales, geológicos-geomorfológicos, paisajísticos y arqueológicos únicos en Chile. Destaca el relieve montañoso, quebradas, lomajes y roqueríos, y formaciones vegetales de niebla, como el “Desierto costero de Tocopilla”.\n\nEste sitio permite el establecimiento de 90 especies de flora silvestre, algunas, son únicas de este lugar, es decir, son endémicas; hasta hoy se han reportado 195 especies de fauna silvestre, entre los que destacan el zorro chilla y gaviotín chico. Hacia la costa es posible observar al pingüino de Humboldt, chungungo, el lobo fino austral, entre otros.','utf-8'),(43,'#REDIRECCIÓN [[Parque Nacional Morro Moreno]]','utf-8'),(44,'{{Parque Nacional\n|Nombre=Parque Nacional Morro Moreno\n|Tipo=Parque nacional\n|División=Region de Antofagasta\n|Subdivisión=Provincia de Antofagasta\n|Ciudad cercana=Antofagasta\n|Superficie=7.314 ha\n|Imagen=Paque-nacional-cerro-moreno.jpg\n}}\n\n\nEl [[nombre::Parque Nacional Morro Moreno]] se encuentra en el sector de la península de Mejillones, Región de Antofagasta, localizado en la cordillera de la Costa entre las comunas de Antofagasta y Mejillones, de la provincia y región de Antofagasta. Está ubicado a 65 kilómetros al norte de la comuna Antofagasta, su superficie corresponde a un total de [[Superficie::7.314 ha|7.314 hectáreas]]\n\nEn este atractivo lugar  existe una diversidad de ambientes continentales, marinos e insulares que poseen importantes y variados recursos faunísticos, vegetacionales, geológicos-geomorfológicos, paisajísticos y arqueológicos únicos en Chile. Destaca el relieve montañoso, quebradas, lomajes y roqueríos, y formaciones vegetales de niebla, como el “Desierto costero de Tocopilla”.\n\nEste sitio permite el establecimiento de 90 especies de flora silvestre, algunas, son únicas de este lugar, es decir, son endémicas; hasta hoy se han reportado 195 especies de fauna silvestre, entre los que destacan el zorro chilla y gaviotín chico. Hacia la costa es posible observar al pingüino de Humboldt, chungungo, el lobo fino austral, entre otros.','utf-8'),(45,'\'\'\'Disclaimer\'\'\'\n\nEsta wiki sirve como una guía para parques y reservas nacionales de Chile :D. La información ha sido obtenida tanto de Wikipedia, Conaf y algunos archivos del OpenData del gobierno de Chile.\n\n== Parques Nacionales ==\n\n{{#ask: [[Tipo::Parque nacional]] \n | ?Nombre\n | ?Pertenece a la division\n | format=table\n | mainlabel=-\n}}\n\n== Reservas Naturales ==\n\n{{#ask: [[Tipo::Reserva natural]] \n | ?Nombre\n | ?Pertenece a la division\n | format=table\n | mainlabel=-\n}}\n\n== Empezando ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Lista de ajustes de configuración]\n* [//www.mediawiki.org/wiki/Manual:FAQ/es FAQ de MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de distribución de MediaWiki]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Regionalizar MediaWiki para tu idioma]','utf-8');
